<template>

  <div class="container">
    <Toast />
    <section class="flex flex-column w-30rem m-auto p-5">
      <InputText 
          v-for="i in informations" 
          :key="i.label" 
          class="p-2 m-1" 
          v-model="i.value" 
          :placeholder="i.label" 
          @keyup.enter="calculer"
        />

      <Button label="Calculer" class="mt-5 btn-test"  @click="calculer" />
    </section>

    <section class="flex flex-column m-auto p-5">

      <div class="flex justify-content-between m-2">
        <Button icon="pi pi-download" class="btn-test p-2" @click="generatePDF" />

        <Button class="btn-test" :label="toggleAll ? 'Tout ouvrir' : 'Tout fermer'" :icon="toggleAll ? 'pi pi-plus' : 'pi pi-minus'" iconPos="right" @click="toggleAll=!toggleAll" />
      </div>
      
      <Panel class="m-2" :toggleable="true" :collapsed=" toggleAll ?true:false">
        <template #header>
            <h3>Chemin de vie </h3>
            <b> {{ specialNumbers.cheminDeVie ? specialNumbers.cheminDeVie.toString() : '' }} </b>
        </template>
        <div>
          <p v-show="!chemin" v-for="(text, index) in texte_chemin_de_vie" :key="index" class="text-left">
            {{index+1}} - {{text}}
          </p>
          <p v-show="chemin" class="text-left">
            {{chemin}} - {{ texte_chemin_de_vie[chemin-1] }}
          </p>
        </div>
      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
          <h3>Objectif de vie</h3>
          <b> {{ specialNumbers.objectifDeVie ? specialNumbers.objectifDeVie.toString() : '' }} </b>
        </template>
        <div>
          <p v-show="!objectif" v-for="(text, index) in texte_objectif_de_vie" :key="index" class="text-left">
            {{index+1}} - {{text}}
          </p>
          <p v-show="objectif" class="text-left">
            {{objectif}} - {{ texte_objectif_de_vie[objectif-1] }}
          </p>
        </div>
      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
          <h3>L’image que je montre aux autres</h3>
        </template>

        <Panel v-show="!jour ? true: text[0].split(',').includes(jour.toString().split('')[0] == 0 ? jour.toString().split('')[1] : jour.toString() )" v-for="(text, index) in Object.entries(texte_images_aux_autres)" :key="index" class="text-left m-2" :toggleable="true" :collapsed="toggleAll ?true:false" >
          <template #header>
            <h3> {{ text[0] }} </h3>
          </template>
          <p v-for="(t,i) in text[1]" :key="i" >
            {{t}}
          </p>
        </Panel>

      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
          <h3>Besoin de réalisation</h3>
          <b> 
            {{ specialNumbers.realisation ? specialNumbers.realisation + ' ' :'' }} 
            {{ specialNumbers.realisationPrenom ? specialNumbers.realisationPrenom + ' ' :'' }} 
            {{ specialNumbers.realisationPrenom2 ?  specialNumbers.realisationPrenom2 + ' ' :'' }} 
            {{ specialNumbers.realisationPrenom3 ? specialNumbers.realisationPrenom3 + ' ' :'' }} 
            {{ specialNumbers.realisationPrenom4 ? specialNumbers.realisationPrenom4 + ' ' :'' }} 
            {{ specialNumbers.realisationNom ? specialNumbers.realisationNom :'' }} 
          </b>
        </template>
        <div>
          <p v-show="!realisation" v-for="(text, index) in texte_besoin_de_realisation" :key="index" class="text-left">
            {{index+1}} - {{text}}
          </p>
          <p v-show="realisation" class="text-left">
            {{realisation}} - {{ texte_besoin_de_realisation[realisation-1] }}
          </p>
        </div>
      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
          <h3>Besoin affectif</h3>
          <b> 
            {{ specialNumbers.affectif ? specialNumbers.affectif + '  ' :'' }} 
            {{ specialNumbers.affectifPrenom ? specialNumbers.affectifPrenom + '   ' :'' }} 
            {{ specialNumbers.affectifPrenom2 ?  specialNumbers.affectifPrenom2 + '   ' :'' }} 
            {{ specialNumbers.affectifPrenom3 ? specialNumbers.affectifPrenom3 + '  ' :'' }} 
            {{ specialNumbers.affectifPrenom4 ? specialNumbers.affectifPrenom4 + '    ' :'' }} 
            {{ specialNumbers.affectifNom ? specialNumbers.affectifNom :'' }} 
          </b>
        </template>
        <div>
          <p v-show="!affectif" v-for="(text, index) in texte_besoin_affectif" :key="index" class="text-left">
            {{index+1}} - {{text}}
          </p>
          <p v-show="affectif" class="text-left">
            {{affectif}} - {{ texte_besoin_affectif[affectif-1] }}
          </p>
        </div>
      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
            <h3>Défis</h3>
        </template>
        <div>
          <p v-show="!challenges.defi1 && !challenges.defi2" v-for="(text, index) in texte_defis" :key="index" class="text-left">
            {{index}} - {{text}}
          </p>
          <div v-show="challenges.defi1 || challenges.defi2">
            <Panel class="m-2 text-left" header="Défi 1" :toggleable="true" :collapsed="toggleAll ?true:false" >
              {{challenges.defi1}} - {{ texte_defis[challenges.defi1] }}
            </Panel>

            <Panel class="m-2 text-left" header="Défi 2" :toggleable="true" :collapsed="toggleAll ?true:false">
              {{challenges.defi2}} - {{ texte_defis[challenges.defi2] }}
            </Panel>

            <Panel class="m-2 text-left" header="Défi 3" :toggleable="true" :collapsed="toggleAll ?true:false">
              {{ challenges.defi3 }} - {{ texte_defis[challenges.defi3] }}
            </Panel>

            <Panel class="m-2 text-left" header="Défi 4" :toggleable="true" :collapsed="toggleAll ?true:false">
              {{ challenges.defi4 }} - {{ texte_defis[challenges.defi4] }}
            </Panel>
          </div>
        </div>

      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
            <h3>Année cycle karmique</h3>
            <b> {{ specialNumbers.anneeCycleKarmique ? specialNumbers.anneeCycleKarmique.toString() : '' }} </b>
        </template>
        <div>
          <p v-show="!karmique" v-for="(text, index) in texte_karmique" :key="index" class="text-left">
            Année {{index+1}} - {{text}}
          </p>
          <p v-show="karmique" class="text-left">
            Année {{karmique}} - {{ texte_karmique[karmique-1] }}
          </p>
        </div>
      </Panel>

      <Panel class="m-2" :toggleable="true" :collapsed="toggleAll ?true:false">
        <template #header>
            <h3>Numéro Spécial</h3>
        </template>
          <p v-for="(text, index) in Object.entries(text_special_nombre)" :key="index" class="text-left">
            {{text[0]}} - {{text[1]}}
          </p>
      </Panel>

    </section>

  </div>
  
</template>

<script setup>
import { ref } from "@vue/reactivity";
import { useToast } from "primevue/usetoast";
import {cheminDeVie, besoinDeRealisationOuAffectif, objectifDeVie, defis, anneeCycleKarmique, SPECIAL} from '../../numerologie/numerologie.js';
import {texte_objectif_de_vie, texte_besoin_de_realisation, texte_besoin_affectif, texte_chemin_de_vie, texte_defis, texte_karmique, text_special_nombre, texte_images_aux_autres} from '../../numerologie/texteNumerologie.js';
import PDF from '../../numerologie/pdf.js';
import pdfMake from 'pdfmake/build/pdfmake.js';
import pdfFonts from 'pdfmake/build/vfs_fonts.js';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

pdfMake.fonts = {
  Alegreya: {
    normal: "Alegreya.ttf"
  },
  Adam: {
    normal: "AdamScript.ttf",
    thin : "AdamScriptThin.ttf",
    light: "AdamScriptLight.ttf"
  },
  AdamLight: {
    normal: "AdamScriptLight.ttf"
  },
  Roboto: {
    normal: 'Roboto-Regular.ttf',
    bold: 'Roboto-Medium.ttf',
    italics: 'Roboto-Italic.ttf',
    bolditalics: 'Roboto-MediumItalic.ttf'
  }
}

const toast = useToast();
let anneeEnCours = new Date().getFullYear().toString();
let toggleAll = ref(true);

let chemin = ref('');
let objectif = ref('');
let realisation = ref('');
let affectif = ref('');
let challenges = ref({})
let karmique = ref('');
let specialNumbers = ref({});

let jour = ref("");

let informations = ref([
  {label: 'Prénom', value: '' },
  {label: 'Deuxième prénom', value: '' },
  {label: 'Troisième prénom', value: '' },
  {label: 'Quatrième prénom', value: '' },
  {label: 'Nom', value: '' },
  {label: 'Date de naissance (12/04/1995)', value: '' }
])

function calculer() {
  if(
    informations.value[0].value.length < 1 ||
    informations.value[4].value.length < 1||
    informations.value[5].value.length < 1
    ) return toast.add({severity:'error', summary: 'Error Message', detail:'Remplir au moins le prénom, le nom et la date de naissance', life: 3000});

  reset();

  jour.value  = informations.value[5].value.split('/')[0];
  let mois  = informations.value[5].value.split('/')[1];
  let annee = informations.value[5].value.split('/')[2];

  chemin.value = cheminDeVie(jour.value, mois, annee);
  objectif.value = objectifDeVie(jour.value, mois);
  realisation.value = besoinDeRealisationOuAffectif(informations.value[0].value, informations.value[1].value, informations.value[2].value, informations.value[3].value, informations.value[4].value, true);
  affectif.value = besoinDeRealisationOuAffectif(informations.value[0].value, informations.value[1].value, informations.value[2].value, informations.value[3].value, informations.value[4].value, false);
  challenges.value = defis(jour.value, mois, annee);
  karmique.value = anneeCycleKarmique(jour.value, mois, anneeEnCours);

  specialNumbers.value = SPECIAL;

} 

function reset() {

  chemin.value = '';
  objectif.value = '';
  realisation.value = '';
  affectif.value = '';
  karmique.value = '';
  jour.value = "";

  challenges.value.defi1 = '',
  challenges.value.defi2 = '',
  challenges.value.defi3 = '',
  challenges.value.defi4 = ''
 
  specialNumbers.value.affectif = false,
  specialNumbers.value.affectifNom = false,
  specialNumbers.value.affectifPrenom = false,
  specialNumbers.value.affectifPrenom2 = false,
  specialNumbers.value.affectifPrenom3 = false,
  specialNumbers.value.affectifPrenom4 = false,
  specialNumbers.value.cheminDeVie = false,
  specialNumbers.value.cycleKarmique = false,
  specialNumbers.value.objectifDeVie = false,
  specialNumbers.value.realisation = false,
  specialNumbers.value.realisationNom = false,
  specialNumbers.value.realisationPrenom = false,
  specialNumbers.value.realisationPrenom2 = false,
  specialNumbers.value.realisationPrenom3 = false,
  specialNumbers.value.realisationPrenom4 = false
  ;
}

function generatePDF(){

    if(
    informations.value[0].value.length < 1 ||
    informations.value[4].value.length < 1||
    informations.value[5].value.length < 1
    ) return toast.add({severity:'error', summary: 'Error Message', detail:'Remplir au moins le prénom, le nom et la date de naissance', life: 3000});

  let post = {};
  
  post.headerBackground = '#ECF0D6';
  post.footerBackground = '#DAC1B1';
  post.headerColor =  'black';
  post.logo = "data:image/png;base64,"
  post.whatsapp = "data:image/png;base64,"
  post.instagram = "data:image/png;base64,"
  post.site = "data:image/png;base64,";
  post.email = "data:image/png;base64,";
  post.date = new Date().toLocaleDateString();

  // Infors perso
  post.prenom        = informations.value[0].value;
  post.prenom2       = informations.value[1].value;
  post.prenom3       = informations.value[2].value;
  post.prenom4       = informations.value[3].value;
  post.nom           = informations.value[4].value;
  post.dateNaissance = informations.value[5].value;

  // Résultats
  post.cheminDeVie       = chemin.value;
  post.objectifDeVie     = objectif.value;
  post.realisation       = realisation.value;
  post.affectif          = affectif.value;
  post.images_aux_autres = jour.value;
  post.karmique          = karmique.value
  post.defis             = [challenges.value.defi1, challenges.value.defi2, challenges.value.defi3, challenges.value.defi4]
  post.specialNumbers    = specialNumbers.value

  // Textes
  post.texte_chemin_de_vie = texte_chemin_de_vie[chemin.value-1];
  post.texte_objectif_de_vie = texte_objectif_de_vie[objectif.value - 1];
  post.texte_besoin_de_realisation = texte_besoin_de_realisation[realisation.value - 1];
  post.texte_besoin_affectif = texte_besoin_affectif[objectif.value-1];
  post.texte_defis = [texte_defis[challenges.value.defi1], texte_defis[challenges.value.defi2], texte_defis[challenges.value.defi3], texte_defis[challenges.value.defi4]]
  post.texte_karmique = texte_karmique[karmique.value];
  post.texte_images_aux_autres = Object.entries(texte_images_aux_autres).filter(x => x[0].split(',').includes( parseInt(jour.value).toString() ));
  post.texte_special_nombre = text_special_nombre;

  let data = PDF(post);
  pdfMake.createPdf(data).download(`Numerologie ${post.prenom} ${post.nom} ${post.dateNaissance.replaceAll('/', '')}.pdf`);
}


</script>

<style scoped>
.btn-test {
  background: var(--lightgreen);
  border-color: var(--lightgreen);
  color: var(--text-color);
}
